(data, labelKey, valueKey = 'id') => {
  let dupValues = data.map(row => {
    return {
      'label': row[labelKey],
      'value': row[valueKey]
    };
  });
  let output = {};
  dupValues.forEach(option => {
    output[option.label] = option;
  });
  let outputProps = Object.getOwnPropertyNames(output);
  return outputProps.map(prop => output[prop]);
}

